import SkillsSection from "./sectionItems/skillsSection";
import ProjectSection from "./sectionItems/projectSection";

function HomeItems(): JSX.Element {

    // Observer for elements
    // useEffect(() => {
        
    //     const animateBlob3 = KUTE.fromTo(
    //         '#blob1',
